script: |
  super -f tsv -I q1693.sql | sort > q1693.out

vector: true

inputs:
  - name: q1693.sql
    data: |
      SELECT e9, a8, c6*671, a2+e9
      FROM t8, t9, t2, t6
      WHERE 790=d6
      AND 310=e8
      AND (c9=254 OR 60=c9)
      AND e2=940;
  - name: t2
  - name: t6
  - name: t8
  - name: t9

outputs:
  - name: q1693.out
    data: |
      195	171	515999	1046
      245	171	515999	1096
